title: KeyDailyLimit
type: object
properties:
  limit:
    minimum: 0
    type: integer
    description: |-
      `number` or `null`. The daily lookup limit currently set on your key. 
      `null` means the limit is currently disabled.
    format: int32
  consumed:
    minimum: 0
    type: integer
    description: Number of lookups performed today which count towards your daily limit.
    format: int32
